import React from 'react';
import styled from 'styled-components';

function Header() {
  return (
    <StyleHeader>
      <h1>
        <span>P</span>roject <span>A</span>pp.
      </h1>
    </StyleHeader>
  );
}

export default Header;

const StyleHeader = styled.header`
  display: flex;
  justify-content: space-between;
`;
